import { Button } from '@material-ui/core'
import React from 'react'
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
    root: {
      display: "flex",
    },
  }));

const RoomPicker = () => {
    const classes = useStyles()

    return (
        <div className={classes.root}>
            <Button color="primary" variant="contained">Room 1</Button>
            <Button color="primary" variant="contained">Room 2</Button>
            <Button color="primary" variant="contained">Room 3</Button>
            <Button color="primary" variant="contained">Room 4</Button>
            <Button color="primary" variant="contained">Room 5</Button>
            <Button color="primary" variant="contained">Room 6</Button>
        </div>
    )
}

export default RoomPicker
